import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../api/api';

export default function VoterDashboard() {
  const [elections, setElections] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchElections = async () => {
      try {
        const res = await api.get('/vote');
        setElections(Array.isArray(res.data) ? res.data : []);
      } catch (err) {
        console.error('Error fetching elections:', err);
      }
    };
    fetchElections();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('isAdmin');
    navigate('/voter-login');
  };

  return (
    <div className="p-6">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-2xl font-bold">Welcome, Voter</h2>
        <button onClick={handleLogout} className="bg-red-600 text-white px-4 py-2 rounded">
          Logout
        </button>
      </div>
      <h3 className="text-lg mb-2">Available Elections:</h3>
      <ul className="list-disc ml-6">
        {elections.length > 0 ? (
          elections.map((election, i) => <li key={i}>{election.title || `Election ${i + 1}`}</li>)
        ) : (
          <li>No elections available</li>
        )}
      </ul>
    </div>
  );
}
